import styled from "styled-components";

export const StyledCardList = styled.div`
    width: 9.375rem;
    height: 12.5rem;
    border: 0.0625rem solid red;
    border-radius: 5px;
    box-shadow: 0.1875rem 0.125rem 0.625rem rgba(0,0,0,0.1);
    display: flex;
    align-items: center;
    justify-content: center;

`;
